import React from "react";
import "./products.scss";
import bg_pass_media from "../../images/products/bg_pass_media@2x.png";
import pass_media_logo from "../../images/pass_media_logo.svg";

const Products = ({ isMobile, dataProducts }) => {
  return (
    <div className="page products__wrap container_big">
      <div className="products__content">
        <h2 className="typography typography--header container">
          <span>| </span>Продукты
        </h2>
        <div className="products__items">
          <div className="products__item">
            <div className="products__item--left">
              <img src={bg_pass_media} alt="pass.media" />
            </div>
            <div className="products__item--right">
              <img src={pass_media_logo} alt="pass.media" />
              <div className="products__description">
                {dataProducts[0].items.map((item, index) => {
                  <div>
                    <h3>{item.title}</h3>
                    <p>{item.text}</p>
                  </div>
                })}
              </div>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};
export default Products;
